import React, { Fragment } from 'react';
import './App.css';

function App() {
  return (
    <Fragment>
      <div className='container'>
        <div className='row'>
          <div className='col-12 heading'>Sawari</div>
        </div>
        <div className='row'>
          <div className='col-12'>
            <form>
              <div className='form-group'>
                <input type='text' placeholder='Username' />
              </div>
            </form>
          </div>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
